script: |
  super -f text -I q4082.spq | sort > q4082.out

inputs:
  - name: q4082.spq
    data: |
      SELECT ALL col0 AS col2 FROM tab2 (FORMAT parquet) cor0 WHERE NOT col2 + col2 * - 11 BETWEEN 92 * + col1 + 66 AND - - 6;
  - name: tab2

outputs:
  - name: q4082.out
    data: |
      46
      64
      75
